//=======================================================================================
BluePrint_Book Intermediate_Production_L1::book()
{
    BluePrint_Book res;

    res.icons.set( 1, "electronic-circuit" );
    res.icons.set( 2, "processing-unit" );
    res.icons.set( 3, Item::Named::petroleum_gas() );
    res.icons.set( 4, Item::Named::heavy_oil() );

    res.add( electronic_circuit() );
    res.add( advanced_circuit() );
    res.add( processor_unit() );
    res.next_line();

    res.add( gas_processing_L1() );
    res.add( oil_station_L1() );
    res.add( coal_liquefaction_L1() );

    return res;
}
